Sinopse:

Em 480 antes de Cristo, durante a famosa batalha de Thermopylae, o rei de Esparta, Leonidas (Gerard Butler), lidera seu exercito contra o avanco dos Persas, comandados por Xerxes (Rodrigo Santoro). Na Historia, a batalha ficou marcada por ter inspirado toda a Grecia a se unir, o que ajudou a solidificar o conceito de democracia que se conhece hoje. Adaptacao dos quadrinhos criados por Frank Miller.

